uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// Uniforms from JSON
uniform float u_speed;
uniform float u_wave_scale;
uniform float u_complexity;
uniform float u_brightness;
uniform float u_color_shift;
uniform float u_distortion;

out vec4 fragColor;

// 2D Rotation matrix
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Pseudo-random noise function
float hash(vec2 p) {
    return fract(sin(dot(p, vec2(127.1, 311.7))) * 43758.5453123);
}

// Seamless Simplex-like Noise
float noise(vec2 p) {
    vec2 i = floor(p);
    vec2 f = fract(p);
    vec2 u = f * f * (3.0 - 2.0 * f);
    return mix(mix(hash(i + vec2(0.0, 0.0)), hash(i + vec2(1.0, 0.0)), u.x),
               mix(hash(i + vec2(0.0, 1.0)), hash(i + vec2(1.0, 1.0)), u.x), u.y);
}

// Fractional Brownian Motion for layered detail
float fbm(vec2 p) {
    float v = 0.0;
    float a = 0.5;
    mat2 m = rot(0.37);
    for (int i = 0; i < 5; i++) {
        v += a * noise(p);
        p = m * p * 2.02;
        a *= 0.5;
    }
    return v;
}

void main() {
    // Correct Aspect Ratio UVs
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    vec2 mouse = (iMouse.xy / iResolution.xy) * 2.0 - 1.0;

    float t = iTime * u_speed;

    // Domain Warping (creating the fluid "ethereal" look)
    vec2 q = vec2(0.0);
    q.x = fbm(uv * u_wave_scale + t * 0.2);
    q.y = fbm(uv * u_wave_scale + vec2(1.0));

    vec2 r = vec2(0.0);
    r.x = fbm(uv * u_wave_scale + 1.0 * q + vec2(1.7, 9.2) + 0.15 * t);
    r.y = fbm(uv * u_wave_scale + 1.0 * q + vec2(8.3, 2.8) + 0.126 * t);

    float f = fbm(uv * u_wave_scale + r * u_distortion);

    // Base Colors: Deep Blue to Cyan
    vec3 col_deep = vec3(0.02, 0.05, 0.2);
    vec3 col_mid = vec3(0.1, 0.3, 0.6);
    vec3 col_bright = vec3(0.4, 0.8, 1.0);
    vec3 col_accent = vec3(0.6, 0.2, 0.9); // Purple shift

    // Mix colors based on the fbm result
    vec3 color = mix(col_deep, col_mid, clamp(f * f * 4.0, 0.0, 1.0));
    color = mix(color, col_bright, clamp(pow(f, 3.0) * 2.0, 0.0, 1.0));

    // Add subtle purple/ethereal highlights
    color = mix(color, col_accent, clamp(length(q) * u_color_shift, 0.0, 1.0));

    // Add "Ray" lines/Waves
    float waves = 0.0;
    for(float i = 1.0; i < u_complexity; i++) {
        uv.x += 0.1 / i * sin(i * uv.y + t + i * 0.5);
        waves += abs(0.002 / uv.x) * u_brightness;
    }

    // Blend waves with the background fluid
    color += waves * col_bright * 0.5;

    // Edge Darkening (Vignette)
    float vignette = 1.0 - length(uv * 0.8);
    color *= pow(vignette, 1.2);

    // Final Glow and Contrast
    color *= u_brightness;
    color = pow(color, vec3(0.9)); // Slight gamma adjustment

    fragColor = vec4(color, 1.0);
}
